import { Component } from '@angular/core';
import { GroceryProductsService } from '../Services/grocery-products.service';

@Component({
  selector: 'app-my-order-list',
  templateUrl: './my-order-list.component.html',
  styleUrls: ['./my-order-list.component.css']
})
export class MyOrderListComponent {

  constructor(private services: GroceryProductsService){}

  myOrdersLists:any = [];


  ngOnInit():void{
   this.refreshViewCartList();
  }

  refreshViewCartList(){
    this.services.getMyOrdersProducts().subscribe((data:any)=>{
      this.myOrdersLists = data;
    });
  }

}
<div class="container">

    <h1>My Orders</h1>
    <div class="row"  *ngFor="let item of myOrdersLists" >

         <div class="detailCard">

          <div class=" col img">
            <img src="../../../assets/Juice.jpg" alt="img">
          </div>
          <div class="col detail">
            <h3>{{item.productName}}</h3>
            <br>
            <p class="quantity"> {{item.quantity}} items</p>
          </div>
          <div class="col operation mx-5">
            <p>May 21,2023</p>
          </div>
         </div> 





    </div>



  </div>
